    const [openExpenseForm, setOpenExpenseForm] = useState(true);

    const saveExpenseDataHandler = (enteredExpenseData) => {

        const expenseData = {
            ...enteredExpenseData,
            id: Math.random().toString(),
        }
        console.log(expenseData);
        props.onAddExpense(expenseData);
    }

    if(openExpenseForm){
        return   <NewExpenseForm onSaveExpensedata={saveExpenseDataHandler} /> ;
    }

    return (
        <div className="new-expense">

        </div>
    );
}
export default NewExpense;
